    def xor_encrypt(self, tips, key):
        ltips = len(tips)
        lkey = len(key)
        secret = []
        num = 0
        for each in tips:
            if num >= lkey:
                num = num % lkey
            tr = each ^ key[num]
            secret.append(str(tr))
            num += 1
        return "".join(secret)
    def xor_decrypt(self,secret, key):
        tips = secret
        ltips = len(tips)
        lkey = len(key)
        secret = []
        num = 0
        for each in tips:
            if num >= lkey:
                num = num % lkey
            tr = each ^ key[num]
            secret.append(str(tr))
            num += 1
        return "".join(secret)

    def aes_encrypt(self, data, key):
        cipher = AES.new(key, AES.MODE_CBC, key)  # 设置AES加密模式 此处设置为CBC模式
        block_size = AES.block_size  # 判断data是不是16的倍数，如果不是用b'\0'补足
        if len(data) % block_size != 0:
            add = block_size - (len(data) % block_size)
        else:
            add = 0
        data += b'\0' * add
        encrypted = cipher.encrypt(data)  # aes加密
        result = binascii.b2a_hex(encrypted)  # b2a_hex encode  将二进制转换成16进制
        return result


